function keypoints = keypoints_leg(in1,in2)
%keypoints_leg
%    KEYPOINTS = keypoints_Arms(IN1,IN2)

%    This function was generated by the Symbolic Math Toolbox version 23.2.
%    03-Dec-2023 17:32:15

