l_BC = in2(11,:);
l_OA = in2(9,:);


% %Right arm
th1 = -in1(1,:);
th2 = -in1(2,:);
t2 = cos(th1);
t3 = sin(th1);
t4 = th1+th2;
t5 = l_AB.*t2;
t6 = l_AB.*t3;
keypoints = reshape([l_OA,0.0,l_OA+t5,t6,l_OA+t5+l_BC.*cos(t4),t6+l_BC.*sin(t4)],[2,3]);




